import React from 'react';
import { connect } from 'react-redux';
import Button from './Button.js'
import './product-stylesheet.css'
import {useDispatch} from 'react-redux'

const Product = (props) => {
    console.log ("props from Product", props)
    return(
        <div className="product-card" >
        <img className="product-image" src={this.props.product.attributes.image} ></img>
        <h3>{props.product.attributes.name}</h3>
        <em><p className="description"> {this.props.product.description}</p></em>
        <p>{props.product.attributes.price}</p>

        <Button handleClick={() => props.add} label="Add to cart"> </Button>
    </div>
    )

}

export default Product
